import React from "react";
/** @jsx jsx */
import { css, jsx } from "@emotion/core";

export default class Project extends React.Component {
  render() {
    return (
      <div
        className="card"
        css={css`
          display: inline-block;
        `}
      >
        <img src={this.props.image} alt={this.props.title} />
      </div>
    );
  }
}
